import React from 'react';
import {robots} from './Robot';
import Card from './Card';

const CardList = (i) => {
	return(
		<div className='flex'>
				    <Card id={robots[i].id} name={robots[i].name} email={robots[i].email} />
		</div>

		);
}

export default CardList;
